-- sales persons
CREATE TABLE `sales_persons` ( 
	`_id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
	`sales_person_no` TEXT,
	`name` TEXT,
	`name2` TEXT,
	`default_location` TEXT,
	`allow_location_change_on_mdsd` TEXT,
